"""## Development of the K-means clustering algorithm

Below is one possible implementation of the K-means algorithm. 

It should be noted that we have not included any max iterations parameter in the algorithm, since the parameterlist to the kmeans algorithm was fixed from the assignment. We would recommend to do so, in order to give the user an opportunity to not let the algorithm run an infinite amount of time. The same could be said about a random seed and so on, so that the user repeatedly could derive the same clusterings on multiple occasions.
"""

def kmeans(x, K, n_init):  
  # variables 
  SCORE = float("inf")
  df = None 

  for run in range(n_init): 

    # Adding two columns representing labels and distance respectively
    X = np.hstack( (x, [[None, None] for _ in x] ) )
    
    #Pick initial clusters at random.
    np.random.seed(run) 
    centroids = x[np.random.choice(X.shape[0], size=K, replace=False), :]

    while(True):
      # caluclate distance to each cluster
      distance_to_cluster = np.array([ [values[0],values[1]] 
                    for values in [min([(label, np.linalg.norm(p-centroid, ord=2) ** 2) 
                    for (label, centroid) in enumerate(centroids) ], 
                    key = lambda e: e[1]) for p in x ] ])


      if ( (distance_to_cluster[:,0] == X[:,-2]).all() ):
        if ( SCORE > X[:-1].sum() ):
          SCORE = X[:-1].sum()
          df = X.copy()
        break  

      # Initiate new values 
      X[:,-2:] = distance_to_cluster

      #calculate new centroids:
      centroids = np.array([ X[ X[:,-2] == label, 0:-2].mean(axis=0) 
          for (label,_) in enumerate(centroids)])

    print("Three Ducks' Kmeans run {} resulted in a clustering with a SSE of: {}".format(run, X[:,-1].sum()))
  return df[:,-2], np.array(centroids)

