# Method for converting the images from the new set of information that 
# we have produced through our kmeans method. 
def convert(labels, points):
  colors = { label : [ int(p) for p in point ] for label, point in enumerate(points)}  
  converted_img = np.array(list(map(lambda x: colors[x], labels)))
  converted_img.resize(_shape)
  return converted_img

